import {NavLink} from "react-router-dom";

export default function RootLayout() {
  return (
    <div>
        <div className="root-layout">
            <header>
                <nav>
                    <h1>Jobrouter</h1>
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/about">About</NavLink>
                </nav>
            </header>
        </div>
      
    </div>
  )
}
